PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "Global_category" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nombre" varchar(200) NOT NULL, "slug" varchar(200) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "Global_usuario_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "usuario_id" bigint NOT NULL REFERENCES "Global_usuario" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "Global_usuario_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "usuario_id" bigint NOT NULL REFERENCES "Global_usuario" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "Global_pack" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nombre" varchar(200) NOT NULL, "slug" varchar(200) NOT NULL, "imagen" varchar(100) NOT NULL, "descripcion" text NOT NULL, "descripcion_larga" text NOT NULL, "precio" decimal NOT NULL, "disponibilidad" bool NOT NULL, "creado" datetime NOT NULL, "actualizado" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "Global_usuarioadminstracion" ("user_id" bigint NOT NULL PRIMARY KEY REFERENCES "Global_usuario" ("id") DEFERRABLE INITIALLY DEFERRED, "nombre_administracion" varchar(400) NOT NULL UNIQUE, "cif" varchar(9) NOT NULL UNIQUE, "pack_id" bigint NULL REFERENCES "Global_pack" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "Global_order_productos" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "order_id" bigint NOT NULL REFERENCES "Global_order" ("id") DEFERRABLE INITIALLY DEFERRED, "product_id" bigint NOT NULL REFERENCES "Global_product" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "Cliente_usuarionormal" ("user_id" bigint NOT NULL PRIMARY KEY REFERENCES "Global_usuario" ("id") DEFERRABLE INITIALLY DEFERRED, "nombreCompleto" varchar(50) NOT NULL, "administracion_id" bigint NULL REFERENCES "Global_usuarioadminstracion" ("user_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "Global_usuario" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "Global_sliderimage" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "image" varchar(100) NOT NULL, "caption" varchar(100) NOT NULL, "created_at" datetime NOT NULL, "nombreAdministración_id" bigint NULL REFERENCES "Global_usuarioadminstracion" ("user_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "Global_contactous" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nombre" text NULL, "email" varchar(254) NULL, "asunto" text NULL, "mensaje" text NULL, "nombreAdministración_id" bigint NULL REFERENCES "Global_usuarioadminstracion" ("user_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "cookie_consent_cookiegroup" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "varname" varchar(32) NOT NULL, "name" varchar(100) NOT NULL, "description" text NOT NULL, "is_required" bool NOT NULL, "is_deletable" bool NOT NULL, "ordering" integer NOT NULL, "created" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "cookie_consent_cookie" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(250) NOT NULL, "description" text NOT NULL, "path" text NOT NULL, "domain" varchar(250) NOT NULL, "created" datetime NOT NULL, "cookiegroup_id" integer NOT NULL REFERENCES "cookie_consent_cookiegroup" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "cookie_consent_logitem" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "action" integer NOT NULL, "version" varchar(32) NOT NULL, "created" datetime NOT NULL, "cookiegroup_id" integer NOT NULL REFERENCES "cookie_consent_cookiegroup" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "Global_lotteryadministration" ("nombreAdministración_id" bigint NOT NULL PRIMARY KEY REFERENCES "Global_usuarioadminstracion" ("user_id") DEFERRABLE INITIALLY DEFERRED, "logo" varchar(100) NOT NULL, "imagen_cabecera" varchar(100) NULL, "color_primario" varchar(7) NOT NULL, "color_secundario" varchar(7) NOT NULL, "color_body" varchar(7) NOT NULL, "direccion" varchar(200) NULL, "horario_apertura" time NULL, "horario_cierre" time NULL, "descripcion" text NULL, "redes_sociales" text NULL CHECK ((JSON_VALID("redes_sociales") OR "redes_sociales" IS NULL)), "sitio_web" varchar(200) NULL, "otros_servicios" text NULL, "activo" bool NOT NULL, "imagen_fondo" varchar(100) NULL, "slogan" varchar(200) NULL, "promociones" text NULL, "productos_destacados" text NULL, "testimonios" text NULL, "politicas_devolucion" text NULL, "puntos_de_venta" text NULL, "eventos_especiales" text NULL, "partners" text NULL, "ultima_actualizacion" datetime NOT NULL, "rating" real NULL, "comentarios" text NULL, "idioma_preferido" varchar(50) NULL, "moneda_preferida" varchar(50) NULL, "politicas_cookies" text NULL, "color_footer" varchar(7) NOT NULL, "politicas_cookies_title" text NULL, "politicas_privacidad_resumen" text NULL, "politicas_privacidad_resumen_title" text NULL, "politicas_privacidad_title" text NULL, "politicas_privacidad" text NULL);
CREATE TABLE IF NOT EXISTS "Global_order" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "paypalId" varchar(200) NULL, "creado" datetime NOT NULL, "actualizado" datetime NOT NULL, "total" decimal NOT NULL, "completado" bool NOT NULL, "correoCliente" varchar(254) NULL, "calle" varchar(50) NULL, "ciudad" varchar(50) NULL, "cPostal" varchar(50) NULL, "provincia" varchar(10) NULL, "nombre" varchar(200) NULL, "apellidos" varchar(200) NULL, "pack_id" bigint NULL REFERENCES "Global_pack" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "Global_usuario" ("id") DEFERRABLE INITIALLY DEFERRED, "validado" bool NOT NULL, "fechaCreacion" date NOT NULL, "administracion_id" bigint NOT NULL REFERENCES "Global_usuarioadminstracion" ("user_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "Global_usuario" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "email" varchar(254) NOT NULL UNIQUE, "username" varchar(100) NOT NULL UNIQUE, "dni" varchar(50) NULL, "calle" varchar(50) NULL, "ciudad" varchar(50) NULL, "cPostal" varchar(50) NULL, "provincia" varchar(10) NULL, "nombre" varchar(200) NULL, "apellidos" varchar(200) NULL, "imagen" varchar(200) NULL, "is_active" bool NOT NULL, "is_staff" bool NOT NULL, "is_superuser" bool NOT NULL, "is_administracion" bool NOT NULL, "is_nomalUser" bool NOT NULL, "telefono" integer NULL UNIQUE, "starter" bool NOT NULL, "date_joined" date NOT NULL, "paypalMail" varchar(254) NULL);
CREATE TABLE IF NOT EXISTS "Global_cart" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "producto_id" bigint NULL REFERENCES "Global_product" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "Global_usuario" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "Global_redsocial" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nombre" varchar(100) NOT NULL, "url" varchar(200) NOT NULL, "icono" varchar(100) NOT NULL, "nombreAdministración_id" bigint NULL REFERENCES "Global_usuarioadminstracion" ("user_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "Global_product" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nombre" varchar(200) NOT NULL, "juego" varchar(50) NOT NULL, "slug" varchar(200) NOT NULL, "imagen" varchar(100) NOT NULL, "descripcion" text NOT NULL, "precio" decimal NOT NULL, "disponibilidad" bool NOT NULL, "creado" datetime NOT NULL, "actualizado" datetime NOT NULL, "categoria_id" bigint NOT NULL REFERENCES "Global_category" ("id") DEFERRABLE INITIALLY DEFERRED, "administracion_id" bigint NOT NULL REFERENCES "Global_usuarioadminstracion" ("user_id") DEFERRABLE INITIALLY DEFERRED, "cantidad" integer NOT NULL, "fecha_sorteo" date NULL, "codigovalidez" varchar(200) NOT NULL);
